import React from "react";
import { Link } from "react-router-dom";


function Home() {
    return(
        <div>
            <p>This is our homepage</p>
            <ul>
                <li>
                    <Link to="/">{"Home"}</Link>

                     <Link to="/about">{"About"}</Link>

                     <Link to="/contact">{"Contact US"}</Link>

                </li>

            </ul>
        </div>

    )
}

export default Home
